
public class fibonassi {
	public static void main(String[] args) {
		// TODO Auto-generated method stub

		//int count=10;
		fibo(10);
	}
	
	static void fibo(int count) {
		int n1=0,n2=1,n3;
		System.out.print(n1+" " + n2);
		for(int i=2;i<=count;++i) {
			n3= n1+n2;
			System.out.print(" "+n3);
			n1=n2;
			n2=n3;
					
		}
	}
}
